import Label from "../../../components/Label";
import Button from "../../../components/Button";

const Info: React.FC = ({ text }) => {
  return (
    <>
      <Card className="wing-blank-lg">
        <Spacer size="mmd" />
        <div className="color-grey">我的保险账户</div>
        <div className="wing-blank">
          <Spacer />
          <div className="flex-jc-center">

            <Label label="市值" value="$ 1,234.45" />

          </div>
          <Spacer />
          <div className="flex-jc-center">
            <CardButton className="width-47 flex-jc-center">
              <div className="color-grey">TVL</div>
              <div>$ 564,564.68</div>
            </CardButton>
            <CardButton className="width-47 flex-jc-center">
              <div className="color-grey">APY</div>
              <div>102.47%</div>
            </CardButton>
          </div>
          <Spacer />
        </div>

        <Spacer size="mmd" />
      </Card>
      <Spacer />
    </>
  );
};

export default Info;
